def reset_app():
    #"D:\LDPlayer\LDPlayer9\dnconsole.exe" quit --index 0
    #"D:\LDPlayer\LDPlayer9\dnconsole.exe" launch --index 0

    subprocess.run(['schtasks', '/run', '/tn', 'close_app'])
    print("đã reset app")
    time.sleep(3)
    subprocess.run(['schtasks', '/run', '/tn', 'lunch_app'])
    print("đã mở app")

    time.sleep(17)
    subprocess.run(["adb", "connect", "emulator-5556"])
    time.sleep(3)

    desired_cap = {
        "uuid": "emulator-5556",
        "platformName": "Android",
        "appPackage": "com.ldmnq.launcher3",
        "appActivity": "com.android.launcher3.Launcher"
    }
    driver = webdriver.Remote("http://localhost:4723/wd/hub", options=AppiumOptions().load_capabilities(desired_cap))
    try:
        print("m1")
        wait = WebDriverWait(driver, 20)
        element = wait.until(EC.element_to_be_clickable((By.XPATH, g7_taxi)))
        print("m2")
    except:
        pass
    print("m3")
    driver.find_element(By.XPATH, g7_taxi).click()
    time.sleep(5)
    print("m4")
    driver.press_keycode(4)
    print("m5")
    time.sleep(3)
    driver.find_element(By.XPATH, g7_taxi).click()
    print("m6")
    time.sleep(5)






